"use strict";(self.webpackChunkcase_itau=self.webpackChunkcase_itau||[]).push([[658],{7174:e=>{e.exports=JSON.parse('{"version":{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"category","label":"Entendimento de Neg\xf3cios","items":[{"type":"link","label":"Persona","href":"/Case-Itau-grupo-4/Entendimento-do-problema/Persona","docId":"Entendimento-do-problema/Persona","unlisted":false},{"type":"link","label":"Jornada Do Usu\xe1rio","href":"/Case-Itau-grupo-4/Entendimento-do-problema/Jornada-do-usuario","docId":"Entendimento-do-problema/Jornada-do-usuario","unlisted":false},{"type":"link","label":"Canvas Proposta de Valor","href":"/Case-Itau-grupo-4/Entendimento-do-problema/canvas-proposta-de-valor","docId":"Entendimento-do-problema/canvas-proposta-de-valor","unlisted":false}],"collapsed":true,"collapsible":true},{"type":"category","label":"Solu\xe7\xe3o","items":[{"type":"link","label":"Requisitos Funcionais","href":"/Case-Itau-grupo-4/Solucao/requisitos-funcionais","docId":"Solucao/requisitos-funcionais","unlisted":false},{"type":"link","label":"Arquitetura","href":"/Case-Itau-grupo-4/Solucao/arquitetura","docId":"Solucao/arquitetura","unlisted":false},{"type":"link","label":"Interface","href":"/Case-Itau-grupo-4/Solucao/interface","docId":"Solucao/interface","unlisted":false},{"type":"link","label":"M\xe9tricas e Resultados Esperados","href":"/Case-Itau-grupo-4/Solucao/resultados-esperados","docId":"Solucao/resultados-esperados","unlisted":false}],"collapsed":true,"collapsible":true}]},"docs":{"Entendimento-do-problema/canvas-proposta-de-valor":{"id":"Entendimento-do-problema/canvas-proposta-de-valor","title":"Canvas Proposta de Valor","description":"O Canvas de Proposta de Valor (Value Proposition Canvas) \xe9 uma ferramenta visual desenvolvida por Alexander Osterwalder para ajudar empresas, empreendedores e equipes a compreender de forma clara como seus produtos ou servi\xe7os geram valor para um p\xfablico espec\xedfico. Ele serve como um guia estruturado para alinhar o que a organiza\xe7\xe3o oferece com aquilo que o cliente realmente precisa, deseja ou valoriza.","sidebar":"tutorialSidebar"},"Entendimento-do-problema/Jornada-do-usuario":{"id":"Entendimento-do-problema/Jornada-do-usuario","title":"Jornada Do Usu\xe1rio","description":"&emsp; A Jornada do Usu\xe1rio \xe9 uma representa\xe7\xe3o visual do caminho que um usu\xe1rio percorre ao interagir com um produto, servi\xe7o ou sistema. Nesse sentido, ela descreve as etapas, as emo\xe7\xf5es, as a\xe7\xf5es e os pontos de contato que o usu\xe1rio experimenta ao longo de sua intera\xe7\xe3o. Dessa maneira, a jornada do usu\xe1rio \xe9 uma ferramenta valiosa para identificar oportunidades de melhoria, pontos de atrito e necessidades n\xe3o atendidas, permitindo que a equipe de design e desenvolvimento crie solu\xe7\xf5es mais eficazes e centradas no usu\xe1rio (Kalbach, 2016).","sidebar":"tutorialSidebar"},"Entendimento-do-problema/Persona":{"id":"Entendimento-do-problema/Persona","title":"Persona","description":"POR QUE CRIAR UMA PERSONA?","sidebar":"tutorialSidebar"},"intro":{"id":"intro","title":"Introdu\xe7\xe3o","description":"1. Vis\xe3o Geral do Projeto"},"Solucao/arquitetura":{"id":"Solucao/arquitetura","title":"Arquitetura","description":"&nbsp;&nbsp;&nbsp;&nbsp;Esta se\xe7\xe3o apresenta a arquitetura proposta da solu\xe7\xe3o, incluindo sugest\xf5es para a organiza\xe7\xe3o do sistema, seus componentes e tecnologias recomendadas. Desse modo, os diagramas ilustram como pode ocorrer a comunica\xe7\xe3o entre as diferentes camadas, enquanto o texto descreve o papel de cada componente e aponta poss\xedveis tecnologias a serem utilizadas.","sidebar":"tutorialSidebar"},"Solucao/interface":{"id":"Solucao/interface","title":"Interface","description":"&emsp;Para exemplificar a solu\xe7\xe3o proposta, foi produzido um mockup do aplicativo Ita\xfa S\xeanior, adaptado \xe0s necessidades do p\xfablico idoso com baixa familiaridade digital. O design mant\xe9m todas as funcionalidades tradicionais do aplicativo original, por\xe9m apresenta uma organiza\xe7\xe3o visual simplificada, linguagem clara e recursos de acessibilidade aprimorados, garantindo que o usu\xe1rio possa usufruir de todas as possibilidades do app sem restri\xe7\xf5es. Al\xe9m disso, foram feitos ajustes estrat\xe9gicos de navega\xe7\xe3o e identidade visual para otimizar a experi\xeancia e o acesso \xe0s funcionalidades.","sidebar":"tutorialSidebar"},"Solucao/requisitos-funcionais":{"id":"Solucao/requisitos-funcionais","title":"Requisitos Funcionais","description":"&emsp; Segundo Sommerville, Sawyer (1997), Pressman e Maxim (2021), a Engenharia de Requisitos se trata da elicita\xe7\xe3o de funcionalidades e restri\xe7\xf5es que uma solu\xe7\xe3o deve atender, refletindo as necessidades e expectativas de stakeholders. Esses requisitos s\xe3o divididos em funcionais, que especificam as a\xe7\xf5es que sistema ou dispositivo deve realizar, e n\xe3o funcionais, que determinam suas limita\xe7\xf5es de escopo, como desempenho, design, seguran\xe7a e usabilidade. Requisitos s\xe3o conceitos essenciais para o desenvolvimento de tecnologias e devem ser analisados com cuidado, conciliando as necessidades dos clientes e as limita\xe7\xf5es t\xe9cnicas, de forma a se desenvolver sistemas de qualidade, confi\xe1veis e eficientes.","sidebar":"tutorialSidebar"},"Solucao/resultados-esperados":{"id":"Solucao/resultados-esperados","title":"M\xe9tricas e Resultados Esperados","description":"Documenta\xe7\xe3o de M\xe9tricas e Resultados Esperados para um Projeto de Transforma\xe7\xe3o Digital","sidebar":"tutorialSidebar"}}}}')}}]);